import axios from 'axios';

export const deleteProduct = async (productId) => {
  try {
    await axios.delete(`http://localhost:8080/api/products/delete${productId}`);
    console.log('Product deleted successfully');
  } catch (error) {
    console.error('Error deleting product:', error);
  }
};

export const updateProduct = async (productId, updatedData) => {
  try {
    await axios.put(`http://localhost:8080/api/products/update${productId}`, updatedData);
    console.log('Product updated successfully');
  } catch (error) {
    console.error('Error updating product:', error);
  }
};

export const insertProduct = async (newProductData) => {
  try {
    await axios.post('hhttp://localhost:8080/api/products/insert', newProductData);
    console.log('Product inserted successfully');
  } catch (error) {
    console.error('Error inserting product:', error);
  }
};
